<img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/exchange.gif" alt="返品・交換について" width="230" border="0"><br><br><img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/title.gif"><br><br>◎ Wパッド(ブラ)<br>◎ ストレッチ(ショーツ)<br><br>＜ブラ＞<br>■ 品質／ナイロン、ポリエステル、その他<br>● 3/4カップ<br>● ワイヤー入り<br>● サイドボーン有り(2本)<br>● 後ろホック2段3列<br>● パッド有り(取り外し可)(Wパッド仕様)<br>〔手洗い〕<br><br>＜ショーツ＞<br>■ 品質／ポリエステル、ナイロン、その他<br>〔洗濯機時ネット使用〕<br><br>＜タンガ＞<br>■ 品質／ナイロン、ポリエステル、その他<br>〔洗濯機時ネット使用〕<br><br>＜スリップ＞<br>■ 品質／ポリエステル、ナイロン、その他<br>● 丈：約75cm(バスト79～87cm対応)<br>〔洗濯機時ネット使用〕<br><br>※ 商品によって柄の出方が異なる場合があります。<br>繊細な小花柄のストレッチレースを全面に使用した、人気の総レースシリーズ。ストレッチレースの下には、マットサテンを敷いて、かすかに見える光沢が高級感を演出。ブラは大輪のバラモチーフを両胸に飾りゴージャスに。ショーツの後ろ身には、はき心地のいいエステル天竺を使用。響かないよう、足口にはレースをたたいたこだわりも。レーススリップには、ブラと同様のバラモチーフをON！ 纏うだけでレディーな気分になれる1着に。<br><br>【陽だまりに映える花柄レースランジェリー】<br>繊細な花柄レースが美しいランジェリーシリーズをご紹介。纏うだけで気分を高揚させる豪華なランジェリーは女らしさに磨きをかけて──。<br><br>薔薇が主役の華やぎレースランジェリー<br><br><img src="http://image.rakuten.co.jp/ryuryu-shop/cabinet/top/line.gif"><br><br><font color="#999999" size="1">色：ワインレッド/グリーン/オフホワイト<br>サイズ：スリップ/M</font><br><br><!-- ページデザイン -->
