【商品説明】<br>繊維１本１本にフッ素系撥水・撥油剤をコーティングすることにより、撥水・撥油・防汚効果を靴に与えるスプレーです。<br><br>使用方法用途など：<BR>容器を良く振ってからご使用下さい。<br>靴の汚れやほこりを落とした後、２０～２５ｃｍ位離してムラなく吹きかけて下さい。<br><br><br>成分：<BR>フッ素樹脂　石油系炭化水素<br>使用上の注意：<BR>湿った靴には乾いてからスプレーして下さい。<br>シミや色落ちする革もございますので、目立たない部分で試してからご使用下さい。<br>保管保存方法：<BR>火気付近・高温直射日光は避けて下さい。<br>問い合わせ先：<BR>〒111-8610 東京都台東区寿4-16-7 株式会社コロンブス　消費者相談室宛 0120-03-7830<br>原産国：日本<br>ブランド：<BR>商品サイズ：46×190×46<br>JANコード：4971671511460<BR>cs：72<BR>商品カテゴリ： お洗濯・衣類・靴ケア ＞ シューケア・靴用品 ＞ 靴磨き・ケア用品　(460101)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
