【商品説明】<br>ツヤとノビのよさが好評！＜ｂｒ＞各種高級ワックスを使用。しばらくは、布で拭くだけで光沢が持続します。<br><br>成分：<BR>ろう、油脂、有機溶剤<br>使用上の注意：<BR>※起毛革（スエード・ベロア・バックスキン等）、ヌメ革、は虫類、オーストリッチ、エナメル、アニリン染めの革、ラム、特殊加工が施されている革には使えません。<br>保管および取扱い上の注意：<BR>直射日光を避け、冷暗所に立てて保管する。高いところに置かない。子供やペットの触れる場所に置かない<br>問い合わせ先：<BR>〒231-0023 横浜市中区山下町SSKビル お問い合わせ窓口 電話(０４５)６４０－２１１１<br>原産国：インドネシア<br>ブランド：KIWI<BR>商品サイズ：72×20×72<br>JANコード：4968306479608<BR>cs：144<BR>商品カテゴリ： お洗濯・衣類・靴ケア ＞ シューケア・靴用品 ＞ 靴磨き・ケア用品　(460101)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
